$(document).ready(function(){console.clear(),$("#header").on("mousemove",e=>{e.preventDefault();let t=document.querySelector(".spaceman > img");var n=t.getAttribute("data-parallax");let a=e.clientX*n,r=e.clientY*n;e=window.innerWidth,n=window.innerHeight;n<e?a*=n/e:r*=e/n,t.style.transform="translate("+-a+"px,"+-r+"px)"})});